";\n        if (min !== Infinity &amp;&amp; max !== -Infinity) {\n            pad = pad ? (max - min) * .03 : 0;\n            range.start = min - pad;\n            range.end = max + pad;\n        } else console.error('backtesting: scale range error:', min, max, range);\n    };\n}\n\nclearTimeout(window._bt_autoscale_timeout);\n\nwindow._bt_autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"1849339","type":"CustomJS"},{"attributes":{"axis":{"id":"1849186"},"coordinates":null,"dimension":1,"group":null,"ticker":null},"id":"1849189","type":"Grid"},{"attributes":{"axis":{"id":"1849182"},"coordinates":null,"group":null,"ticker":null},"id":"1849185","type":"Grid"},{"attributes":{"data":{"datetime":{"__ndarray__":"AAAA7v83dkIAAIC5pDh2QgAAQB/3OHZCAABATYo7dkIAAEDk0zx2QgAAAHi5P3ZCAADAouhDdkIAAACZvEh2QgAAgPuqSnZCAAAAx09LdkIAAACMLE92QgAAwPF+T3ZCAADAiMhQdkIAAMC2W1N2QgAAAH+cVXZCAABAsJNWdkIAAEBH3Vd2QgAAgHjUWHZCAAAA28JadkIAAAByDFx2QgAAQKMDXXZCAAAAoJ9edkIAAMAF8l52QgAAgGtEX3ZCAADA+GFldkIAAIBetGV2QgAAQFtQZ3ZCAABA8plodkIAAADvNWp2QgAAwFSIanZCAACAutpqdkIAAEDlCW92QgAAgK1KcXZCAABAE51xdkIAAIBElHJ2QgAAwKMednZCAADAOmh3dkIAAEAGDXh2QgAAADE8fHZCAADALdh9dkIAAABfz352QgAAQOzshHZCAAAAUj+FdkIAAMC3kYV2QgAAwOUkiHZCAAAAFxyJdkIAAIDiwIl2QgAAAEWvi3ZCAAAAc0KOdkIAAACh1ZB2QgAA
